    false,nt"url": null,nt"notes": "We undertook creating the first ever seamless
    statewide General Plan map for California. All county general plans and many city
    general plans were integrated into 1 statewide Geographic Information System (GIS)
    dataset. The data was then standardized to thirteen consistent land use classifications
    for the intent of natural resource and infrastructure planning. This data represents
    one of the two-part GIS datasets. This part is the 'source' General Plans. This
    dataset represents the general plans as they were delivered to us from counties,
    after they were rectified to 13 standard land use classes. The sister dataset is
    a scenario of landuse more adequately representing current residential and rural
    residential growth. This work took place at the University of California Davis.
    The data is freely available and distributed through the California Resources Agency.",nt"license_title":
